import UserPost from "./components/UserPost";
// import './App.css';
import {    BrowserRouter, Route,Router,Routes,Navigate} from 'react-router-dom';



const App = () => {
  return(<User />);
{ <>
<BrowserRouter>

        <Routes>
            <Route path="/" element={<div>home</div>} />
            <Route path="/User-post" element={<UserPost/>}/>
        </Routes>

    </BrowserRouter>
</> }
};

export default App;
